import React from "react"

export class Difficulty extends React.Component {
    state = {
        level: "easy"
    };

    handleChange = (event) => {
        this.setState({
            level: event.value
        });
    };

    render() {
        return (
            <div
                className="difficulty">
                <label
                    className="difficulty-level">
                    Easy
                    <input
                        className="difficulty-radio"
                        name="level"
                        type="radio"
                        value="easy"
                        checked={false}
                        onChange={this.handleChange}/>
                </label>
            </div>
        )
    }
}
